<script setup lang="ts">
import Card from '../components/Card.vue'
import ImageCarousel from '../components/ImageCarousel.vue'
import { StarIcon, CheckCircleIcon } from '@heroicons/vue/solid'
import BaseBtn from '../components/base/BaseBtn.vue'
import { ref, computed } from 'vue'
import { GoogleMap, Marker, Circle } from 'vue3-google-map'
import { Calendar, DatePicker } from 'v-calendar'
import 'v-calendar/dist/style.css'

// Check out https://vuejs.org/api/sfc-script-setup.html#script-setup

interface Filter {
	name: string
	value: string
}

interface Position {
	lat: number
	lng: number
}

interface Item {
	name: string
	description: string
	price: string
	priceUnit: string
	postalcode: string
	address: string
	position: Position
	images: string[]
	startDate: string
	endDate: string
	categories: string[]
	filters: Filter[]
}

interface Lender {
	userId: number
	firstName: string
	lastName: string
	username: string
	rating: number
	pictureUrl: string
	trusted: boolean
}

interface ItemResponse {
	item: Item
	lender: Lender
}

const { item, lender }: ItemResponse = {
	item: {
		name: 'En stol',
		description: 'En veldig kul stol',
		price: '100',
		priceUnit: 'dag',
		postalcode: '12345',
		address: 'Stolveien 123',
		position: { lat: 63.41916940570157, lng: 10.402702797111004 },
		images: [
			'data:image/jpeg;base64,',
			'data:image/jpeg;base64,',
			'data:image/jpeg;base64,',
			'data:image/jpeg;base64,',
			'data:image/jpeg;base64,',
		],
		startDate: '2022-04-20T18:00:00',
		endDate: '2022-06-20T18:00:00',
		categories: ['category1', 'category2'],
		filters: [
			{
				name: 'filter1',
				value: 'value1',
			},
			{
				name: 'filter2',
				value: 'value2',
			},
		],
	},
	lender: {
		userId: 1,
		firstName: 'Henrik',
		lastName: 'Hansen',
		username: 'henhan',
		rating: 3,
		pictureUrl:
			'https://i1.sndcdn.com/artworks-FMJtFdT1qYskUjoP-y0ixOw-t500x500.jpg',
		trusted: true,
	},
}

function randomCenter(position: Position) {
	const newPosition: Position = {
		lat: position.lat + Math.random() * 0.004 - 0.002,
		lng: position.lng + Math.random() * 0.004 - 0.002,
	}
	return newPosition
}

const range = computed(() => ({
	start: new Date(item.startDate),
	end: new Date(item.endDate),
}))
</script>

<template>
	<div class="grid gap-4">
		<h1 class="text-4xl font-bold">{{ item.name }}</h1>
		<p>{{ item.description }}</p>
		<ImageCarousel :images="item.images" />
		<Card>
			<div class="flex gap-4 w-full justify-between">
				<img class="w-16 h-16 rounded-full" :src="lender.pictureUrl" />
				<div class="grid gap-2">
					<p class="font-bold text-lg">
						{{ lender.firstName }} {{ lender.lastName }}
					</p>
					<p class="text-slate-500">@{{ lender.username }}</p>
					<div class="flex gap-2">
						<StarIcon
							v-for="icon in Math.floor(lender.rating)"
							class="h-6 w-6 text-yellow-400"
						/>
					</div>
				</div>
				<span class="flex-grow"></span>
				<CheckCircleIcon
					class="h-8 w-8 justify-self-start text-blue"
					v-if="lender.trusted"
				/>
			</div>
		</Card>
		<div>
			<p class="font-bold text-lg">Pris</p>
			<p>{{ item.price }} / {{ item.priceUnit }}</p>
		</div>
		<div>
			<p class="font-bold text-lg">Kategori</p>
			<div class="flex gap-4">
				<div
